import Box from '@mui/material/Box';
import React from 'react';
import DirectionsRunIcon from '@mui/icons-material/DirectionsRun';
import { Typography } from '@mui/material';


export const Logo = () => {
  return (
    <Box
      sx={{
        display: 'flex',
        gap: 1,
        alignContent: 'center',
        alignItems: 'center',
      }}
      
    >
      <DirectionsRunIcon />
      <Typography>
        
      </Typography>
    </Box>
  );
};
